;*******************************************************************************
;Compare D with	min and	max values, clamp D if outside range.
;
;
;Inputs
;    D - Value to check/clamp.
;    Y - Address of max	& min table, both 16 bits.
;Outputs
;    D - Value clamped if out of range.
;    Carry - Set if value clamped.
;*******************************************************************************

; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


clamp_rD:							; loc_CCD4p
				cmp	d, y + 00h		; Check	if D > maximum value...
				bgt	min_max_clamp		; ...Jump to exit, clamp D to maximum value
				inc	y
				inc	y			; Advance Y to minimum value
				cmp	d, y + 00h		; Check	if D >=	minimum	value...
				bcc	min_max_done		; ...jump to exit, leave D as it is with carry flag cleared

min_max_clamp:							; C605j
				ld	d, y + 00h		; Clamp	D to minimum or	maximum	value
				setc				; Set carry flag to indicate D was clamped

min_max_done:							; C60Bj
				ret				; Finished
; End of function clamp_rD

				ld	a, dmarx_ect

loc_C613:							; CF6Ep ...
				clr	b
				.db  8Ch ; Њ
				ld	d, var_rpm_x_5p12

; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ

; *******************************************************************************
; Performs 2-D map lookup with interpolation
;
; Inputs
;     A	- Lookup value (x).
;     B	- ???
;     Y	- Pointer to map.
;	  First	byte of	map is offset to last entry.
;	  Map consist of byte pairs (x,y).
;
; Outputs
;     A	- Interpolated value from map
;     B	- ???
; *******************************************************************************

table_pair_interpolate:
				mov	d, x			; Store	A & B for user later
				ld	a, [y]			; Get offset to	last entry in map
				push	y			; Save Y on stack for later
				add	y, a			; Y = &Map[max]
				mov	x, d			; Restore A & B
				cmp	a, y + 00h		; Check	if A < Map[max]...
				bcs	loc_C623		; ...jump forward if so
				pull	x			; Clean	up stack
				bra	loc_C628		; A > Map[max],	so jump	forward	to clip	to max value

loc_C623:							; C61Ej
				pull	y			; Y = &Map[0]
				cmp	a, y + 00h		; If A >= Map[Y] then...
				bcc	loc_C62E		; ...keep searching map

loc_C628:							; C621j ...
				ld	a, y + 01h		; A < Map[0] or	A > Map[max] or	B = 0, so get appropriate min or max value in map
				clr	b			; Nothing to the right of the decimal place
				ret				; Finished

loc_C62C:							; C630j
				inc	y
				inc	y			; Advance Y to next entry in map

loc_C62E:							; C626j
				cmp	a, y + 02h		; Check	if A >=	Map[Y+2]...
				bcc	loc_C62C		; ...jump back to move to next entry in	map
				ld	a, y + 02h		; Map[Y] <= A <	Map[Y+2]
				sub	a, y + 00h		; A = Map[Y+2] - Map[Y]
				push	a			; Save Map[Y+2]	- Map[Y] on stack
				mov	x, d			; Restore A & B
				sub	a, y + 00h		; A = A	- Map[Y]
				mov	s, x			; X now	points to Map[Y+2] - Map[Y] on the stack
				div	d, x + 00h		; B = (A * 256)	/ (Map[Y+2] - Map[Y])
				inc	s			; Clean	up stack
				ld	a, y + 03h		; A = Map[Y+3]
				sub	a, y + 01h		; A = Map[Y+3] - Map[Y+1]
				bcc	loc_C64A		; Jump forward if Map[Y+1] <= Map[Y+2]
				neg	a			; A = Map[Y+1] - Map[Y+3]
				neg	b			; B = (A * 256)	/ (Map[Y] - Map[Y+2])
				beq	loc_C628		; If B is 0 then jump back to set A = Map[Y+1]
				inc	y
				inc	y			; Advance Y to next entry in map

loc_C64A:							; C642j
				push	b			; Save B on stack
				mov	s, x			; X now	points to B
				mul	a, x + 00h		; A = (A * B) /	256
								; B = (A * B) &	0xFF
				add	a, y + 01h		; A = A	+ Map[Y+1]
				inc	s			; Clean	up stack
				ret				; Finished
; End of function table_pair_interpolate


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


