;****************************************************************************************************
;Interpolate value in 2-D lookup table with fixed index	delta
;
;Inputs
;    B - Value to interpolate
;    A - 256/Index delta between entries
;    Y - Pointer to map/table
;	 byte min index	value for lookup table
;	 byte max index	value for loopup table
;
;Outputs
;    A - Interpolated value
;****************************************************************************************************

; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


table_rB_fixed_rA_interpolate:					; C663j
				sub	b, y + 00h		; B = value - table.min
				bcs	loc_C695		; Jump if value	< 0
				push	a			; Push A on to stack
				cmp	b, y + 01h		; Check	if (value - table.min) < table.max
				ble	loc_C677		; ...jump forward if so
				ld	b, y + 01h		; B = value = table.max

loc_C677:							; C673j
				mov	s, x			; Set X	to point to (256/delta)	on stack
				mov	b, a			; A = value - table.min
				mul	a, x + 00h		; D = (value - table.min) * (256/delta)
				inc	s			; Clean	up stack
