;********************************************************************************
;ASR2 Interrupt, triggered from	NE signal.
;Update	NE counters
;
;There are 2 counters, one counts from 0 to 5, this corresponds	to the crank position.
;The other counts from 0 to 3, this corresponds	to the active cylinder.
;
;The second counter is incremented when	the first wraps, both counter reset back to 0 after 24 pulses.
;********************************************************************************

; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


				; public int_vector_e_asr2
int_vector_e_asr2:						; FFFAo

; FUNCTION CHUNK AT D3FF SIZE 00000007 BYTES

				clrb	bit6, IRQLL		; Clear	IRQLL.6, interrupt vector E latch
				push	x
				push	y
				ld	b, var_ne_count		; NE counter
								; Bits 0-3: Counter 0->5, corresponds crank position
								; Bits 4-7: Counter 0->3, corresponds to cylinder
				tbbc	bit1, PORTD_ASRIN, g2_low ; Jump if PORTD.1 (G2) is low
				tbbc	bit0, PORTD_ASRIN, g1_low ; Jump if PORTD.0 (G1) is low
				cmpz	b			; Compare NE counter against 0
				bmi	loc_D3CC		; Jump if negative
				mov	b, a
				inc	b			; Increment NE counter
				and	a, #0Fh			; Only keep lower nibble (crank	position)
				cmp	a, #05h			; Check	if counter is less than	5...
				bcs	loc_D3CC		; ... and jump to store	new counter value in B
				and	b, #0F0h		; Reset	lower nibble (crank position) back to 0
				add	b, #10h			; Increment cylinder counter
				mov	b, a
				cmp	b, #20h			; Check	if reached cylinder 3...
				beq	loc_D3CB		; ...and jump to store new counter value in A
				cmp	b, #40h			; Check	if cylinder count reached limit...
				bne	loc_D3CC		; ...and jump if not to	store counter value in B
				clr	a			; Reset	position and cylinder count both back to 0.
				bra	loc_D3CB		; Jump to store	new counter value in A
;G2 signal is low, check NE counter is correct,	reset counter if it's out of sync.

g2_low:								; D39Aj
				clr	a
				cmp	b, #35h
				beq	loc_D3CB
				bra	loc_D3C8
;G1 signal is low, check NE counter is correct,	reset counter if it's out of sync.

g1_low:								; D39Dj
				ld	a, #20h
				cmp	b, #15h
				beq	loc_D3CB

loc_D3C8:							; D3C0j
				cmpz	b
				bmi	loc_D3CB

loc_D3CB:							; D3B2j ...
				mov	a, b

loc_D3CC:							; D3A1j ...
				st	b, var_ne_count		; NE counter
								; Bits 0-3: Counter 0->5, corresponds crank position
								; Bits 4-7: Counter 0->3, corresponds to cylinder
				bra	int_vector_e_return
; End of function int_vector_e_asr2


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


init_ne_counters:						; loc_C88Ep ...
				ld	d, #5500h		; Load D with max ASR2 delta
				ld	y, #var_ne_table	; Get address of NE table
				st	d, [y]			; Store	max value
				st	d, [y]			; Store	max value
				st	d, [y]			; Store	max value
				ld	d, #0FFFFh
				st	d, var_ne_sum		; Initialise sum of entries
				st	a, var_ne_count		; Reset	NE pulse counters to 0xFF
				st	a, var_ne_count_dup
				ret
; End of function init_ne_counters


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


check_starter_running:						; D474p
				tbbc	bit2, var_input_bits, loc_D3F7
				tbs	bit7, unk_47
				bne	locret_D3FE
				cmp	#0Ch, var_cnt4ms_A3
				bcs	locret_D3FE
				ld	a, #0FFh
				st	a, var_ne_count		; Reset	NE pulse count
				st	a, var_ne_count_dup
				bra	locret_D3FE

loc_D3F7:							; check_starter_runningj
				tbbc	bit7, unk_47, locret_D3FE
				clrb	bit7, unk_47
				clr	var_cnt4ms_A3

locret_D3FE:							; D3E8j ...
				ret
; End of function check_starter_running

; START	OF FUNCTION CHUNK FOR int_vector_e_asr2

int_vector_e_return:						; D3CEj
				clrb	bit4, var_flags_40	; Clear	bit 4 to indicate NE pulse interrupt just occurred
				setb	bit1, IRQLL		; Trigger IV6
				pull	y
				pull	x
				reti
; END OF FUNCTION CHUNK	FOR int_vector_e_asr2

; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


iv6_ne_process:							; D5DDp
				ld	x, ASR2			; ASR2 edge counter value MSB
				st	x, var_asr2_count	; Store	ASR2 value for later
				clr	a			; Initialise flag indicating NE	pulse received
				ld	b, var_ne_count		; NE counter
								; Bits 0-3: Counter 0->5, corresponds crank position
								; Bits 4-7: Counter 0->3, corresponds to cylinder
				bpz	loc_D411		; Jump forward if value	isn't negative (0xFF is reset value)
				ld	a, #08h			; Flag indicating no NE	pulses received	yet

loc_D411:							; D40Dj
				xch	a, var_cnt8ms_AF	; Store	flag, get previous flag
				xch	b, var_ne_count_dup	; Store	NE counter, get	previous value
				cmpz	b			; Check	if old value is	negative (0xFF is reset	value)
				bmi	loc_D433		; Jump forward if it is	negative
				ld	b, var_ne_count_dup	; Get NE counter again
				and	b, #07h			; Mask out top bits to just keep crank position
				cmpb	b, #01h			; Check	if bit 0 set
				bne	loc_D43D		; Jump if bit is set (crank position is	odd)
				ld	y, #var_ne_table	; Get base address of NE table
				add	y, b			; Calculate address to store new value
				cmp	a, #08h			; ????
				bcc	loc_D42F		; ????
				mov	x, d			; Copy X to D
				sub	d, var_asr2_count2	; Get delta from previous ASR2 value
				cmp	a, #55h			; Check	if delta less than 5500h
				bcs	loc_D432		; Jump forward if so

loc_D42F:							; D426j
				ld	d, #5500h		; Set delta to 5500h

loc_D432:							; D42Dj
				st	d, [y]			; Store	delta into table

loc_D433:							; D416j
				st	x, var_asr2_count2	; Store	ASR2 value
				ld	d, var_ne_table		; Sum values of	table...
				add	d, var_ne_table+2
				add	d, var_ne_table+4
				st	d, var_ne_sum		; Store	sum

loc_D43D:							; D41Ej
				ld	a, var_ne_count_dup
				cmp	a, #00h
				beq	loc_D447
				cmp	a, #20h
				bne	loc_D449

loc_D447:							; D441j
				clrb	bit2, var_flags_41

loc_D449:							; D445j
				and	a, #07h
				bne	locret_D44F
				clrb	bit0, var_flags_41

locret_D44F:							; D44Bj
				ret
; End of function iv6_ne_process


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


				; public int_vector_c_timer
int_vector_c_timer:						; FFF6o
				clrb	bit4, IRQL		; Clear	IRQL.4,	interrupt vector C latch
				push	x
				push	y
				ld	a, TIMER		; Timer	MSB (bit11~bit18)
				shr	a
				shr	a
				shr	a
				bcc	loc_D45E
				jsr	output_odb_bit

loc_D45E:							; D459j
				clrb	bit3, var_flags_40	; Clear	bit 3 to request 4ms update
				setb	bit1, IRQLL		; Trigger IV6
				pull	y
				pull	x
				reti
; End of function int_vector_c_timer


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


iv6_4ms_process:						; D5E4p
				ld	d, #((var_cnt4ms_obd_byte << 8)	+ 13) ;	Increment counters at 0A2h - 0AEh
				jsr	increment_counters
				jsr	check_io_inputs
				jsr	serial_debug_check
				jsr	serial_dma_start
				jsr	check_starter_running
				jsr	drive_DOUT0
				jsr	drive_DOUT2_tvsv
				jsr	generate_vf_PORTA_4
				cmp	#086, var_cnt4ms_A4	; Check	if counter has reached value to	trigger	speed update
				bcs	loc_D496		; Jump if not there yet
				clr	var_cnt4ms_A4		; Reset	counter
				jsr	update_spd		; Calculate speed
				ld	d, var_rpm_x_5p12
				shr	d
				shr	d
				div	d, var_spd
				bcc	loc_D494
				ld	b, #0FFh

loc_D494:							; D490j
				st	b, var_rpm_div_spd

loc_D496:							; D483j
				ld	a, TIMER		; Timer	MSB (bit11~bit18)
				shr	a
				shr	a
				shr	a
				bcs	process_8ms		; Jump on average every	8ms
				shr	a
				bcs	process_16ms		; Jump on average every	16ms
				shr	a
				bcs	process_32ms		; Jump on average every	32ms
				shr	a
				bcs	process_64ms		; Jump on average every	64ms
				bra	update_4ms_return

process_64ms:							; D4A4j
				clrb	bit7, var_flags_41
				bra	update_4ms_return

process_32ms:							; D4A1j
				clrb	bit6, var_flags_41
				bra	update_4ms_return

process_16ms:							; D49Ej
				clrb	bit5, var_flags_41
				clrb	bit4, var_flags_41
				bra	update_4ms_return

process_8ms:							; D49Bj
				ld	d, #((var_cnt8ms_AF << 8) + 2) ; Increment counters from 0AFh to 0B0h
				jsr	increment_counters
				cmp	#05h, var_cnt4ms_obd_byte
				bgt	loc_D4CA
				tbbs	bit6, unk_47, loc_D4CA
				tbs	bit6, var_flags_40
				beq	loc_D4CA
				clrb	bit6, var_flags_40

loc_D4CA:							; D4BFj ...
				jsr	next_odb_byte

update_4ms_return:						; D4A6j ...
				ret
; End of function iv6_4ms_process


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


serial_dma_start:						; D2D7p ...
				cmp	#04h, var_cnt4ms_AE
				ble	loc_D4DF
				ld	a, unk_126
				and	a, #0BFh
				st	a, unk_126
				st	a, ASR0N		; ASR0 neg edge	counter	value MSB
				bra	loc_D4E9

loc_D4DF:							; D4D1j
				ld	a, TIMER3		; Timer	LSB (bit0~bit2)
				cmpb	a, #40h
				beq	loc_D4FD
				cmpb	a, #08h
				bne	loc_D4EB

loc_D4E9:							; D4DDj
				clr	var_cnt4ms_AE

loc_D4EB:							; D4E7j
				ld	a, unk_126
				or	a, #40h
				st	a, unk_126
				st	a, ASR0N		; ASR0 neg edge	counter	value MSB
				ld	d, #814Dh
				st	d, ASR3			; ASR3 edge counter value MSB
				ld	#0B7h, TIMER3		; Timer	LSB (bit0~bit2)

loc_D4FD:							; D4E3j
				cmp	#28h, unk_55
				bcs	loc_D516
				clrb	bit2, IMASKL
				ld	a, unk_126
				and	a, #7Fh
				st	a, unk_126
				st	a, ASR0N		; ASR0 neg edge	counter	value MSB
				ld	a, TIMER3		; Timer	LSB (bit0~bit2)
				or	a, #80h
				st	a, TIMER3		; Timer	LSB (bit0~bit2)
				bra	loc_D53F

loc_D516:							; D500j
				setb	bit2, IMASKL
				cmp	#04h, var_cnt4ms_AD
				bcs	locret_D543
				ld	a, unk_126
				and	a, #7Fh
				st	a, ASR0N		; ASR0 neg edge	counter	value MSB
				or	a, #80h
				st	a, unk_126
				st	a, ASR0N		; ASR0 neg edge	counter	value MSB
				ld	d, #9127h
				st	d, ASR2			; ASR2 edge counter value MSB
				ld	#4Fh, TIMER3		; Timer	LSB (bit0~bit2)
				ld	b, unk_56
				inc	b
				bne	loc_D539
				dec	b

loc_D539:							; D536j
				st	b, unk_56
				cmp	b, #01h
				bcs	loc_D541

loc_D53F:							; D514j
				setb	bit6, unk_47

loc_D541:							; D53Dj
				clr	var_cnt4ms_AD

locret_D543:							; D51Bj
				ret
; End of function serial_dma_start


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


				; public int_vector_0
int_vector_0:							; FFDEo
				push	x
				push	y
				clrb	bit2, IRQLL
				ld	b, unk_55
				ld	a, TIMER3		; Timer	LSB (bit0~bit2)
				cmpb	a, #30h
				bne	loc_D55E
				tbbs	bit2, RAMST, loc_D55E	; Built-in RAM status
				clr	var_cnt4ms_AD
				clr	unk_56
				clr	b
				setb	bit5, unk_47
				clrb	bit6, unk_47
				bra	loc_D564

loc_D55E:							; D54Ej ...
				clrb	bit5, unk_47
				inc	b
				bne	loc_D564
				dec	b

loc_D564:							; D55Cj ...
				st	b, unk_55
				ld	d, #9127h
				st	d, ASR2			; ASR2 edge counter value MSB
				ld	#4Fh, TIMER3		; Timer	LSB (bit0~bit2)
				ld	b, RAMST		; Built-in RAM status
				ld	b, UNK1C
				pull	y
				pull	x
				reti
; End of function int_vector_0


; ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ S U B	R O U T	I N E ЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫЫ


