				ld	y, #var_serbus_rx

loc_D57B:							; D583j
				ld	d, [y]			; Copy 33 words
				st	d, x + 00h
				inc	x
				inc	x
				cmp	x, #var_spd_edge_count
				bcs	loc_D57B
				ld	d, var_serbus_rx+1Eh
				st	d, dmarx_unk_4B
				ld	a, var_serbus_rx+20h
				st	a, dmarx_var_flags_46
				ld	a, var_serbus_rx+21h
